description:
Requirements: Microsoft Windows Mobile, operating system 300 MHz processor, 64 MB memory, QVGA, VGA or WVGA touch screen display
Overview: The new software version, optimized for PDAs, features several new functions designed to facilitate en-route navigation. When driving on a highway, exits are easier to identify, as the program displays signposts and road signs. When approaching the next maneuver, the program simplifies navigation by only displaying the most important street names, so they can be more easily identified. What's more, the new version of Nav N Go iGO 8 is also available in new resolutions, and requires even less memory, which means it will run on a significantly increased number of devices. Supported resolutions are: 240x240, 240x320, 240x400, 320x240, 320x320, 400x240, 640x480, 480x240, 480x800 and 800x480


